const fs            = require('fs');
const types         = require("@babel/types");
const parser        = require("@babel/parser");
const traverse      = require("@babel/traverse").default;
const generator     = require("@babel/generator").default;


//js混淆代码读取
process.argv.length > 2 ? encodeFile = process.argv[2]: encodeFile ="./encode.js";
process.argv.length > 3 ? decodeFile = process.argv[3]: decodeFile ="./decodeResult.js";

//将源代码解析为AST
let sourceCode = fs.readFileSync(encodeFile, {encoding: "utf-8"});

let ast    = parser.parse(sourceCode);


console.time("处理完毕，耗时");

const simplifyLiteral = {
	NumericLiteral({node}) {
		if (node.extra && /^0[obx]/i.test(node.extra.raw)) {
			node.extra = undefined;
		}
  },
  StringLiteral({node}) 
  {
  	if (node.extra && /\\[ux]/gi.test(node.extra.raw)) {
  		node.extra = undefined;
    }
  },
}


traverse(ast,simplifyLiteral);



const removeDeadCode = {
  "EmptyStatement|DebuggerStatement"(path)
  {
  	path.remove();
  }, 
}


traverse(ast, removeDeadCode);  //PS：因为有赋值语句和定义语句同时存在，因此该插件可能需要运行多次才能删除干净。

const keyToLiteral = {
   MemberExpression:
   {
      exit({node})
      {
         const prop = node.property;
         if (!node.computed && types.isIdentifier(prop))
         {
            node.property = types.StringLiteral(prop.name);
            node.computed = true;
         }
    }
  },   
  ObjectProperty: 
  {
      exit({node})
      {
         const key = node.key;
         if (!node.computed && types.isIdentifier(key))
         {
            node.key = types.StringLiteral(key.name);
            return;
         }
         if (node.computed && types.isStringLiteral(key))
         {
            node.computed = false;
         }
      }
   },  
}

traverse(ast, keyToLiteral);


const changeForCall = 
{
	CallExpression(path)
	{
		let {callee,arguments} = path.node;
		if (!types.isMemberExpression(callee) || arguments.length < 2 || !types.isIdentifier(arguments[0],{"name":"undefined"}))
		{
			return;
		}
		
		let {object,property} = callee;
		

		
		if (types.isStringLiteral(property,{"value":"call"}))
		{
			let callNode = types.CallExpression(object,arguments.slice(1));
			path.replaceWith(callNode);
			return;
		}
		
		if (types.isStringLiteral(property,{"value":"apply"}) &&
		    arguments.length == 2 && types.isArrayExpression(arguments[1]))
		{
			let callNode = types.CallExpression(object,arguments[1].elements);
			path.replaceWith(callNode);
		}		

	}
}


traverse(ast, changeForCall);


const constantFold = {
    "BinaryExpression|UnaryExpression"(path) {
        if(path.isUnaryExpression({operator:"-"}) || 
    	   path.isUnaryExpression({operator:"void"}))
    	{
    		return;
    	}
        const {confident, value} = path.evaluate();
        if (!confident)
            return;
        if (typeof value == 'number' && (!Number.isFinite(value))) {
            return;
        }
        path.replaceWith(types.valueToNode(value));
    },
}

traverse(ast, constantFold);


